// SPDX-License-Identifier: MIT
pragma solidity 0.8.30;

contract SmartCobtractWallet {
    address payable owner;

    mapping(address => uint) public allowance;
    mapping(address => bool) public isAllowedToSend;

    mapping(address => bool) public guardians;
    address payable nextOwner;
    mapping(address => mapping(address =>bool)) nextOwnerGuardianVoteBool;
    uint guardianResetCount;
    uint public constant confirmationFromGuardianForReset = 3;

    constructor() {
        owner = payable(msg.sender);
    }

    function setGuardian(address _guardian, bool _isGuardian) public {
        require(msg.sender == owner,"You are not the owner, aborting!");
        guardians[_guardian]=_isGuardian;
    }

    function proposeNewOwner(address payable _newOwner) public {
        require(guardians[msg.sender], "You are not guardian of this wallet, aborting!");
        require(nextOwnerGuardianVoteBool[_newOwner][msg.sender] == false, "You already");
        if(_newOwner!=nextOwner){
            nextOwner=_newOwner;
            guardianResetCount = 0;
        }
        guardianResetCount++;

        if(guardianResetCount >= confirmationFromGuardianForReset) {
            owner=nextOwner;
            nextOwner=payable(address(0));
        }
    }

    function setAllowance(address _for, uint _amount) public {
        require(msg.sender == owner, "You are not the owner, aborting !");
        allowance[msg.sender] = _amount;

        if(_amount > 0) {
            isAllowedToSend[_for]=true;
        }else{
            isAllowedToSend[_for]= false;
        }
    }

    function transfer(
        address payable _to,
        uint256 _amount,
        bytes memory _payload
    ) public returns (bytes memory) {
        require(msg.sender == owner, "you are not the owner, aborting!");
        if(msg.sender != owner) {
            require(isAllowedToSend[msg.sender], "You are not allowed to send anything from this smart contract, aborting!");
            require(allowance[msg.sender]>=_amount, "You are trying to send more than you allowed to, aborting!");

            allowance[msg.sender]-= _amount;
        }

        (bool success, bytes memory returnData) = _to.call{value: _amount}(
            _payload
        );
        require(success, "Aborting, call was not successful");
        return returnData;
    }

    receive() external payable {}
}

